import Particles from "react-tsparticles";
import { Container } from "./styles";
import { Hero } from "../Hero/Hero";
import { About } from "../About/About";
import { Contact } from "../Contact/Contact";
import { Project } from "../Project/Project";

export function Main() {
  return (
    <Container>
      <Particles
        id="tsparticles"
        options={{
          fullScreen: {
            enable: true,
            zIndex: 1
          },
          detectRetina: true,
          fpsLimit: 60,
          interactivity: {
            events: {
              onClick: {
                enable: true,
                mode: "push"
              },
              onHover: {
                enable: true,
                mode: "bubble"
              }
            },
            modes: {
              bubble: {
                distance: 400,
                duration: 2,
                opacity: 0.8,
                size: 2
              },
              push: {
                quantity: 2
              }
            }
          },
          particles: {
            color: {
              value: "#ffffff"
            },
            move: {
              enable: true,
              speed: 2
            },
            number: {
              value: 15
            },
            opacity: {
              value: 1
            },
            shape: {
              type: ["image"],
              image: [
                {
                  src: "/path/to/your/image1.png",
                  width: 20,
                  height: 20
                },
                {
                  src: "/path/to/your/image2.png",
                  width: 20,
                  height: 20
                },
                // Add more images here
              ]
            },
            size: {
              value: 16
            }
          },
          background: {
            color: "#000000"
          }
        }}
      />

      <Hero />
      <About />
      <Project />
      <Contact />
    </Container>
  );
}
